import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';

import LoginScreen from '../screens/LoginScreen';
import SignupScreen from '../screens/SignupScreen';
import ManagementEmployeeScreen from '../screens/ManagementEmployeeScreen';

const Stack = createStackNavigator();

const Navigator = () => (
    <Stack.Navigator>
        <Stack.Screen name="LoginScreen" component={LoginScreen}></Stack.Screen>
        {/* <Stack.Screen name="SignupScreen" component={SignupScreen}></Stack.Screen> */}
        <Stack.Screen name="ManagementEmployeeScreen" component={ManagementEmployeeScreen}></Stack.Screen>
    </Stack.Navigator>
)

export default Navigator;
